import Signin from "./Components/Pages/Signin/index";
import Signup from "./Components/Pages/Signup/Signup";
import { Route, Routes } from "react-router-dom";
import Home from "./Components/Pages/Home/Home";
// import AddProjects from "./Components/Pages/Projects/AddProjects";
// import AllProjects from "./Components/Pages/Projects/DisplayProjects/AllProjects";
import ProjectsPath from "./Components/Pages/Projects/ProjectsPaths";
import Projects from "./Components/Pages/Projects/AllProjects";
import "./App.css"
import StickyFooter from "./Components/Footer";
import { useState } from "react";
import AddProjects from "./Components/Pages/Projects/AddProjects";

function App() {
  const [project, setProject] = useState([])
  return (
    <div className="app">
      {/* <AllProjects /> */}
      <Routes>
        <Route path="/" element={<Home />}></Route>
        <Route path="/signin" element={<Signin />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/projects" element={<ProjectsPath />} />
        <Route exact path="/projects/:type" element={<Projects projectName={project}/>}/>
        <Route path="/projects" element={<AddProjects setProjectName={setProject} />} />

      </Routes>
      {/* <StickyFooter/> */}
      <AddProjects setProjectName={setProject}/>
    </div>
  );
}

export default App;
